import React from "react";
import MealItem from "./MealItem/MealItem";

import styles from "./MealList.module.css";

import error from "../../img/error.jpg";
const DUMMY_MEALS = [
  {
    id: "m1",
    img: error,
    name: "Шаурма на углях",
    description: "Свинана ням ням",
    weight: "130",
    price: "290",
  },
  {
    id: "m2",
    img: error,
    name: "Шашлык",
    description: "Свинана ням ням",
    weight: "130",
    price: "300",
  },
  {
    id: "m2",
    img: error,
    name: "Шашлык",
    description: "Свинана ням ням",
    weight: "130",
    price: "300",
  },
  {
    id: "m2",
    img: error,
    name: "Шашлык",
    description: "Свинана ням ням",
    weight: "130",
    price: "300",
  },
];

function MealList() {
  const mealList = DUMMY_MEALS.map((meal) => (
    <MealItem
      key={meal.id}
      id = {meal.id}
      img={meal.img}
      name={meal.name}
      description={meal.description}
      weight={meal.weight}
      price={meal.price}
    />
  ));
  return <section className={styles.container}>{mealList}</section>;
}

export default MealList;
